import React from "react";

import { motion } from "framer";

import "./Logo.css";
import engranaje from "../../images/Logo/engranaje.png";
import manoDeSpock from "../../images/Logo/manoDeSpock.png";
import olivo from "../../images/Logo/olivo.png";
import cbIzquierdo from "../../images/Logo/cbIzquierdo.png";
import cbDerecho from "../../images/Logo/cvDerecho.png";

const Logo = () => {
  return (
    <div className="row justify-content-center">
      <div className="col-4">
        <div className="row">
          <motion.img src={engranaje} className="img-fluid" alt="Engranaje" />
          <img
            src={manoDeSpock}
            className="img-fluid"
            alt="Mano de Spock"
            style={{ position: "absolute" }}
            initial={{ opacity: 0 }}
            animate={props.controls}
            transition={{ duration: 1 }}
          />
          <img
            src={olivo}
            className="img-fluid"
            alt="Hoja de Olivo"
            style={{ position: "absolute" }}
          />
          <img
            src={cbIzquierdo}
            className="img-fluid"
            alt="Curly Braces Izquierdo"
            style={{ position: "absolute" }}
          />
          <img
            src={cbDerecho}
            className="img-fluid"
            alt="Curly Braces Derecho"
            style={{ position: "absolute" }}
          />
        </div>
      </div>
    </div>
  );
};

export default Logo;
